class ListAdminComponent {
    constructor(router, toastr, adminService) {
        this.router = router;
        this.toastr = toastr;
        this.adminService = adminService;
        this.admins = [];
    }
    ngOnInit() {
        this.getAdmins();
    }
    // tslint:disable-next-line: typedef
    getAdmins() {
        this.adminService.getAdmins().subscribe(res => {
            this.admins = res;
        }, err => {
            this.toastr.error('Error en la Api');
        });
    }
    // tslint:disable-next-line: typedef
    crear() {
        this.router.navigate([
            'admin',
            'admin',
            'create'
        ]);
    }
    // tslint:disable-next-line: typedef
    editar(codigo) {
        console.log(codigo);
        const codigoaeditar = codigo;
        this.toastr.info('Editar Admin');
        this.router.navigate([
            'admin',
            'admin',
            'update',
            codigoaeditar
        ]);
    }
    eliminar(codigo) {
        this.adminService.deleteAdmin(codigo).subscribe(res => {
            this.mensaje = res;
            this.router.navigate([
                'admin',
                'admin',
                'list'
            ]);
        });
    }
}
