class CreateBlogComponent {
    constructor(router, toastr, blogService, parrafoService, videoService, imagenService) {
        this.router = router;
        this.toastr = toastr;
        this.blogService = blogService;
        this.parrafoService = parrafoService;
        this.videoService = videoService;
        this.imagenService = imagenService;
        this.blog = {
            id: 0,
            Title: '',
            Resume: '',
            Image: '',
            Video: ''
        };
        this.blog1 = {
            id: 0,
            Title: '',
            Resume: '',
            Image: '',
            Video: ''
        };
        this.dato = {
            id: 0,
            Subtitle: '',
            Paragraph: '',
            Image: '',
            Video: '',
            BlogId: 0
        };
        this.bandera = false;
        this.datosimagen = [];
        this.datosvideo = [];
        this.parrafos = [];
    }
    changeImg() {
        this.fileimagen.nativeElement.click();
    }
    // tslint:disable-next-line: typedef
    changeMedia() {
        this.filevideo.nativeElement.click();
    }
    // tslint:disable-next-line: typedef
    changeImagen() {
        // this.showAvatarUpload = true;
        const files = this.fileimagen.nativeElement.files;
        console.log(files);
        // let progress = this.uploadService.upload(images);
        this.imagenService.uploadimage(files[0], 'image').subscribe((resimage) => {
            console.log(resimage);
            this.datosimagen = resimage;
            this.laurlimagen = this.datosimagen.data.url;
            console.log(this.laurlimagen);
            this.blog.Image = this.laurlimagen;
        }, console.error);
    }
    // tslint:disable-next-line: typedef
    changeVideo() {
        // this.showAvatarUpload = true;
        const files = this.filevideo.nativeElement.files;
        // let progress = this.uploadService.upload(images);
        this.videoService.uploadvideo(files[0], 'video').subscribe((resvideo) => {
            console.log(resvideo);
            this.datosvideo = resvideo;
            this.laurlvideo = this.datosvideo.data.url;
            console.log(this.laurlvideo);
            this.blog.Video = this.laurlvideo;
        }, console.error);
    }
    // tslint:disable-next-line: typedef
    saveBlog() {
        delete this.blog.id;
        console.log(this.blog);
        this.blogService.saveBlog(this.blog).subscribe(res => {
            this.blog1 = res;
            this.codigoblog = this.blog1.id;
            this.dato.BlogId = this.codigoblog;
            this.bandera = true;
            this.toastr.success('Nuevo blog creado');
        }, err => {
            console.error(err);
            this.toastr.error('no se pudo crear un nuevo blog');
        });
    }
    saveParrafo() {
        console.log(this.dato);
        this.parrafoService.saveParrafo(this.dato).subscribe(res => {
            if (res) {
                this.parrafos.push(this.dato);
                this.toastr.info('parrafo creado');
            }
            else {
                this.toastr.error('no se puede crear el parrafo');
            }
        });
    }
    delete(dato) {
        console.log(dato);
        const parametro = dato.id;
        const indice = this.parrafos.indexOf(dato);
        this.parrafoService.deleteParrafo(parametro).subscribe(res => {
            if (res) {
                this.mensaje = res;
                this.parrafos.splice(indice, 1);
                this.toastr.info('parrafo eliminado correctamente');
            }
            else {
                this.toastr.error('no se pudo eliminar');
            }
        });
    }
    finish() {
        this.router.navigate([
            'admin',
            'blog',
            'list'
        ]);
    }
    ngOnInit() {
    }
}
