class UpdateBlogComponent {
    constructor(router, toastr, blogService, activatedRoute, parrafoService, videoService, imagenService) {
        this.router = router;
        this.toastr = toastr;
        this.blogService = blogService;
        this.activatedRoute = activatedRoute;
        this.parrafoService = parrafoService;
        this.videoService = videoService;
        this.imagenService = imagenService;
        this.blog = {
            id: 0,
            Title: '',
            Resume: '',
            Image: '',
            Video: ''
        };
        this.datosimagen = [];
        this.datosvideo = [];
        this.cambio1 = true;
        this.igual1 = true;
        this.cambio2 = true;
        this.igual2 = true;
        this.parrafos = [];
        this.elparrafo = {
            id: 0,
            Subtitle: '',
            Paragraph: '',
            Image: '',
            Video: '',
            BlogId: 0
        };
    }
    // tslint:disable-next-line: typedef
    changeImagen() {
        this.fileimagen.nativeElement.click();
    }
    // tslint:disable-next-line: typedef
    changeMedia() {
        this.filevideo.nativeElement.click();
    }
    // tslint:disable-next-line: typedef
    changeImage() {
        // this.showAvatarUpload = true;
        const files = this.fileimagen.nativeElement.files;
        // let progress = this.uploadService.upload(images);
        this.imagenService.uploadimage(files[0], 'image').subscribe((resimage) => {
            console.log(resimage);
            this.datosimagen = resimage;
            this.laurlimagen = this.datosimagen.data.url;
            console.log(this.laurlimagen);
            this.blog.Image = this.laurlimagen;
        }, console.error);
    }
    // tslint:disable-next-line: typedef
    changeVideo() {
        // this.showAvatarUpload = true;
        const files = this.filevideo.nativeElement.files;
        // let progress = this.uploadService.upload(images);
        this.videoService.uploadvideo(files[0], 'video').subscribe((resvideo) => {
            console.log(resvideo);
            this.datosvideo = resvideo;
            this.laurlvideo = this.datosvideo.data.url;
            console.log(this.laurlvideo);
            this.blog.Video = this.laurlvideo;
        }, console.error);
    }
    // tslint:disable-next-line: typedef
    updateBlog() {
        // tslint:disable-next-line: one-variable-per-declaration
        const params = this.activatedRoute.snapshot.params;
        this.blogService.updateBlog(params.id, this.blog).subscribe(res => {
            console.log(res);
            this.mensaje1 = res;
            this.toastr.success('actualizando los datos del blog');
        }, err => {
            console.error(err);
            this.toastr.error('no se pudo actualizar');
        });
    }
    ngOnInit() {
        const params = this.activatedRoute.snapshot.params;
        const codigo = params.id;
        if (params.id) {
            this.blogService.getBlog(codigo).subscribe(res => {
                this.blog = res;
                this.toastr.info('datos del blog');
            }, err => {
                this.toastr.error('no se pudo sacar los datos del blog');
            });
            this.parrafoService.getBlog(codigo).subscribe(res => {
                if (res) {
                    this.parrafos = res;
                    console.log(res);
                    this.toastr.info('los parrafos del blog');
                }
                else {
                    this.toastr.error('no se pudo traer los parrafos del blog');
                }
            });
        }
    }
    elegir(dato) {
        this.parrafoService.getParrafo(dato).subscribe(res => {
            this.elparrafo = res;
        }, err => {
            this.toastr.error('no se pudo acceder');
        });
    }
    updateparrafo(codigazo, elparrafo) {
        const params = this.activatedRoute.snapshot.params;
        const elcodigo = params.id;
        const parrafin = {
            id: codigazo,
            Parrafo: elparrafo,
            BlogId: elcodigo
        };
        this.parrafoService.updateParrafo(codigazo, parrafin).subscribe(res => {
            if (res) {
                this.mensaje = res;
                this.router.navigate([
                    'admin',
                    'blog',
                    'update',
                    elcodigo
                ]);
                this.toastr.info('se actualizo correctamente');
            }
            else {
                this.toastr.error('no se pudo actualizar');
            }
        });
    }
    delete(dato) {
        const params = this.activatedRoute.snapshot.params;
        const elcodigo = params.id;
        const parametro = dato.id;
        const indice = this.parrafos.indexOf(dato);
        this.parrafoService.deleteParrafo(parametro).subscribe(res => {
            if (res) {
                this.mensaje = res;
                console.log(this.mensaje);
                this.parrafos.splice(indice, 1);
                this.toastr.info('parrafo eliminado correctamente');
                this.router.navigate([
                    'admin',
                    'blog',
                    'update',
                    elcodigo
                ]);
            }
            else {
                this.toastr.error('no se pudo eliminar');
            }
        });
    }
    finish() {
        this.router.navigate([
            'admin',
            'blog',
            'list'
        ]);
    }
}
