class CreateHorarioComponent {
    constructor(router, toastr, horaService, horarioService, especialistaService) {
        this.router = router;
        this.toastr = toastr;
        this.horaService = horaService;
        this.horarioService = horarioService;
        this.especialistaService = especialistaService;
        this.data = {
            inicio: 0,
            fin: 0,
            dia: '',
            especialista: 0
        };
        this.horario = {
            id: 0,
            Day: '',
            EspecialistaId: 0,
            HoraId: 0,
        };
        this.horario1 = {
            id: 0,
            Day: '',
            EspecialistaId: 0,
            HoraId: 0,
        };
        this.horas = [];
        this.especialistas = [];
        this.previo = [];
        this.numeros = [];
        this.dias = [
            {
                id: 1,
                name: 'lunes'
            },
            {
                id: 2,
                name: 'martes'
            },
            {
                id: 3,
                name: 'miercoles'
            },
            {
                id: 4,
                name: 'jueves'
            },
            {
                id: 5,
                name: 'viernes'
            },
            {
                id: 6,
                name: 'sabado'
            },
            {
                id: 7,
                name: 'domingo'
            },
        ];
        this.intervalos = [15, 20, 30];
        this.turnos = ['', ''];
        this.bandera = 'proceso1';
        this.miniproceso = 'nada';
        this.mostrartabla = false;
    }
    selectturno(valor) {
        this.turnoelegido = valor;
    }
    intervalo(valor) {
        const parametro = this.intervalos[valor].toString();
        const parametro2 = this.turnoelegido;
        this.horaService.getHoraFilter(parametro, parametro2).subscribe(res => {
            this.horas = res;
            this.bandera = 'proceso2';
            this.miniproceso = 'inicio';
            this.toastr.success('Horas en el invervalo elegido');
        }, err => {
            console.error(err);
            this.toastr.success('Error en el invervalo elegido');
        });
    }
    inicio(valor) {
        this.data.inicio = valor;
        this.miniproceso = 'fin';
    }
    final(valor) {
        this.data.fin = valor;
        this.miniproceso = 'nada';
        this.bandera = 'proceso3';
    }
    getEspecialistas() {
        this.especialistaService.getEspecialistas().subscribe(res => {
            this.especialistas = res;
        }, err => {
            console.error(err);
        });
    }
    rango() {
        const inicio = this.data.inicio;
        const fin = this.data.fin + 1;
        const alv = [];
        for (let counter = inicio; counter < fin; counter++) {
            alv.push(counter);
            this.numeros = alv;
        }
        console.log(this.numeros);
    }
    elejir(codigo3) {
        this.bandera = 'proceso4';
        const codigo = codigo3;
        this.data.especialista = codigo;
        this.horario.EspecialistaId = codigo;
    }
    diaelegido(name) {
        this.rango();
        const wasa = {
            Cupo: 0,
            Day: '',
            EspecialistaId: 0,
            HoraId: 0,
        };
        this.data.dia = name;
        const diaelegido = name;
        this.horario.Day = diaelegido;
        wasa.Day = this.data.dia;
        wasa.EspecialistaId = this.data.especialista;
        console.log(this.numeros);
        const array = this.numeros;
        for (const obj of array) {
            // console.log(obj);
            const cupito = +array.indexOf(obj) + 1;
            wasa.Cupo = cupito;
            wasa.HoraId = obj;
            console.log(wasa);
            this.horarioService.saveHorario(wasa).subscribe(res => {
                console.log(res);
            }, err => {
                this.toastr.error('Error Api');
                // console.log(err);
            });
        }
        this.horarioService.getHorarioEspecialidaddDia(this.data.dia, this.data.especialista.toString()).subscribe(respreview => {
            this.previo = respreview;
            this.toastr.success('Horario creado del dia elegido');
            this.toastr.info('Procedemos a crear otro horario o finalizar');
        }, err => {
            console.log(err);
        });
        this.bandera = 'proceso1';
        this.mostrartabla = true;
        console.log(this.previo);
    }
    limpiar() {
        this.previo = [];
        this.mostrartabla = false;
    }
    finish() {
        this.router.navigate([
            'admin',
            'horario',
            'list'
        ]);
    }
    ngOnInit() {
        this.getEspecialistas();
    }
}
