class ListHorarioComponent {
    constructor(router, toastr, horarioService, especialistaService
    // private especialidadService: EspecialidadService
    ) {
        this.router = router;
        this.toastr = toastr;
        this.horarioService = horarioService;
        this.especialistaService = especialistaService;
        this.especialistas = [];
        this.horarios = [];
        this.filtro1horario = [];
        this.filtro2horario = [];
        this.banderadia = false;
        this.banderatarde = false;
        this.dias = [
            { id: 1, name: 'lunes' },
            { id: 2, name: 'martes' },
            { id: 3, name: 'miercoles' },
            { id: 4, name: 'jueves' },
            { id: 5, name: 'viernes' },
            { id: 6, name: 'sabado' },
            { id: 7, name: 'domingo' },
        ];
        this.data = {
            dia: '',
            codigo: 0
        };
        this.especialista = {
            id: 0,
            Turn: '',
            EspecialidadId: 0,
            DoctorId: 0,
        };
        this.especialistadetalle = {
            id: 0,
            Turn: '',
            EspecialidadId: 0,
            DoctorId: 0,
            especialidad: {
                id: 0,
                Name: '',
                Image: '',
                Price: 0
            },
            doctor: {
                id: 0,
                Name: '',
                LastName: '',
                MedicalSchoolNumber: '',
                Email: '',
                Photo: ''
            }
        };
        this.detailespecialista = this.especialistadetalle;
        this.datos = {
            nombre: '',
            doctor: '',
            dia: ''
        };
    }
    crear() {
        this.router.navigate([
            'admin',
            'horario',
            'create'
        ]);
    }
    getEspecialistas() {
        this.especialistaService.getEspecialistas().subscribe(res => {
            this.especialistas = res;
        }, err => console.error(err));
    }
    elejir(codigo) {
        this.data.codigo = codigo;
        this.especialistaService.getEspecialista(codigo).subscribe(res => {
            this.especialista = res;
            this.detailespecialista = res;
            this.datos.doctor = this.detailespecialista.doctor.Name + ' ' + this.detailespecialista.doctor.LastName;
            this.datos.nombre = this.detailespecialista.especialidad.Name;
            this.data.codigo = codigo;
        }, err => {
            console.log(err);
        });
    }
    diaelegido(name) {
        this.data.dia = name;
        this.datos.dia = name;
    }
    viewhorario() {
        console.log(this.data);
        const dia = this.data.dia.toString();
        const codigo = this.data.codigo.toString();
        this.horarioService.getHorarioEspecialidaddDia(dia, codigo).subscribe(res => {
            this.horarios = res;
            const array = this.horarios;
            const filtro1 = [];
            const filtro2 = [];
            const parametro1 = 'mañana';
            const parametro2 = 'tarde';
            for (const obj of array) {
                const par = obj.hora.Turn;
                if (par === parametro1) {
                    filtro1.push(obj);
                    this.filtro1horario = filtro1;
                }
                else if (par === parametro2) {
                    filtro2.push(obj);
                    this.filtro2horario = filtro2;
                }
            }
            if (Object.entries(this.filtro1horario).length > 0) {
                this.banderadia = true;
            }
            if (Object.entries(this.filtro2horario).length > 0) {
                this.banderatarde = true;
            }
            this.toastr.info('Horario del especialista Elegido');
        });
    }
    // editar(wasa) {
    //   console.log(wasa);
    //   this.toastr.warning('la edicion esta disponible en la version platinum');
    //   this.router.navigate(
    //     [
    //       'admin',
    //       'horario',
    //       'update',
    //       wasa
    //     ]
    //   );
    // }
    ngOnInit() {
        this.getEspecialistas();
    }
}
