class ListLaboratorioComponent {
    constructor(router, toastr, tipoService, laboratorioService) {
        this.router = router;
        this.toastr = toastr;
        this.tipoService = tipoService;
        this.laboratorioService = laboratorioService;
        this.laboratorios = [];
        this.tipos = [];
        this.bandera = false;
        this.tipo = {
            id: 0,
            Name: ''
        };
    }
    ngOnInit() {
        // this.getlaboratorios();
        this.gettipos();
    }
    gettipos() {
        this.tipoService.getTipos().subscribe(res => {
            this.tipos = res;
        }, err => {
            this.toastr.error('Error Api tipo');
        });
    }
    ver(codigo) {
        const parametro = codigo;
        this.laboratorioService.getLaboratorioTipo(parametro).subscribe(res => {
            this.laboratorios = res;
        }, err => console.error(err));
    }
    updateTipo() {
        // llamando a laboratorio de creacion que esta enlazada con el api
        this.tipoService.updateTipo(this.codigotipo, this.tipo).subscribe(res => {
            console.log(res);
            this.mensaje = res;
            this.toastr.success('Tipo actualizado');
            this.bandera = false;
        }, err => {
            console.error(err);
            this.toastr.error('no se pudo actualizar tipo');
        });
    }
    // tslint:disable-next-line: typedef
    crear() {
        this.router.navigate([
            'admin',
            'laboratorio',
            'create'
        ]);
    }
    edit(codigo) {
        this.bandera = true;
        this.codigotipo = codigo;
        this.tipoService.getTipo(codigo).subscribe(res => {
            this.tipo = res;
        }, err => {
            this.toastr.error('Error api tipo get');
        });
    }
    // tslint:disable-next-line: typedef
    editar(codigo) {
        console.log(codigo);
        const codigoaeditar = codigo;
        this.toastr.info('Editar Tipo');
        this.router.navigate([
            'admin',
            'laboratorio',
            'update',
            codigoaeditar
        ]);
    }
    delete(codigo) {
        this.tipoService.deleteTipo(codigo).subscribe(res => {
            this.mensaje = res;
            console.log(res);
            window.location.reload();
            // this.router.navigate(
            //   [
            //     'admin',
            //     'laboratorio',
            //     'list'
            //   ]
            // );
        });
        // window.location.reload();
    }
    deletelab(codigo) {
        this.laboratorioService.deleteLaboratorio(codigo).subscribe(res => {
            this.mensaje = res;
            console.log(res);
            window.location.reload();
            // this.router.navigate(
            //   [
            //     'admin',
            //     'laboratorio',
            //     'list'
            //   ]
            // );
        });
    }
}
