        this.doctorService = doctorService;
        this.horarioService = horarioService;
        this.especialistaService = especialistaService;
        this.especialistas = [];
        this.doctores = [];
        this.reservasdia = [];
        this.horario = [];
        this.filtrada = [];
        this.horariofiltrado = [];
        this.filtro1horario = [];
        this.filtro2horario = [];
