class UpdateTratamientoComponent {
    constructor(router, toastr, activatedRoute, tratamientoService) {
        this.router = router;
        this.toastr = toastr;
        this.activatedRoute = activatedRoute;
        this.tratamientoService = tratamientoService;
        this.tratamiento = {
            id: 0,
            Name: '',
            Detail: '',
            Price: 0
        };
    }
    ngOnInit() {
        const params = this.activatedRoute.snapshot.params;
        if (params.id) {
            this.tratamientoService.getTratamiento(params.id).subscribe(res => {
                console.log(res);
                this.tratamiento = res;
            }, err => {
                this.toastr.error('Datos no obtenidos');
            });
        }
    }
    updateTratamiento() {
        const params = this.activatedRoute.snapshot.params;
        console.log(this.tratamiento);
        // llamando a servicio de creacion que esta enlazada con el api
        this.tratamientoService.updateTratamiento(params.id, this.tratamiento).subscribe(res => {
            console.log(res);
            this.router.navigate([
                'admin',
                'tratamiento',
                'list'
            ]);
            this.toastr.success('Nuevo tratamiento creado');
        }, err => {
            console.error(err);
            this.toastr.error('no se pudo crear un nuevo tratamiento');
        });
    }
}
